module.exports = "<p>A \"virtual meeting\" will be held a day or so after the transcript of the \"real meeting\" is available.\r\n Here people can discuss issues raised at the real meeting, plus raise additional ones.\r\n  Only people who have registered for this location can attend.\r\n</p>\r\n<ul>\r\n  This meeting will be structured similar to a \"real meeting\".\r\n  It will attempt to adhere to Robert's Rule Of Order as closely as possible:\r\n  <li>\r\n     There will be a set starting time.\r\n  </li>\r\n  <li>\r\n    The initial agenda will be the list of issues already discussed at the real meeting.\r\n  </li>\r\n  <li>\r\n     At the start of the meeting, new items can be added to the agenda.\r\n    A vote will be taken on each topic to decide whether to include it.\r\n  </li>\r\n  <li>\r\n    Each item will be discussed in the order on the agenda.\r\n     The software will generate a time schedule of when discussion on each issue is estimated to start.\r\n  </li>\r\n  <li>\r\n    Attendees can be alerted when discussion of specific issues are about to start.\r\n    They will be sent a text message or email at that time.\r\n  </li>\r\n  <li>\r\n     When discussion on an issue starts, all attendees will have a specific time limit to submit remarks on the issue. (time limit TBD)\r\n  </li>\r\n  <li>\r\n    Remarks will be limited to a  maximum length (perhaps 150 words - TBD)\r\n  </li>\r\n  <li> When the first round of discussion has expired, there will be one (or more) rounds.\r\n     They will be slightly longer in time so that everyone also has time to read remarks from the prior round.\r\n  </li>\r\n  <li>\r\n    At this time, attendees may vote to add an additional round of discussion on the current topic.\r\n  </li>\r\n  <li>\r\n    Remarks may not include discussion of personalities or another's motives.\r\n    Inappropriate remarks may be flagged as such by other attendees. Remarks with a specified minimum number of flags will be deleted.\r\n  </li>\r\n</ul>\r\n"

